import React from "react";

const styles = theme => ({
  appHeader: {
    flexGrow: 1,
  },
  drawerHeader: {
    display: "flex",
    alignItems: "center",
    padding: theme.spacing(0, 1, 1, 2),
    // necessary for content to be below app bar
    ...theme.mixins.toolbar,
    justifyContent: "flex-start",
  },
  mainArea: {
    margin: theme.spacing(3),
  }
});

export default styles;
